        <div className="about-us-page-about-container">
            <div className="about-us-page-about-block">

                <div className="about-us-page-about-image">
                    <img src={about1} alt=""/>
                </div>
                <div className="about-us-page-about-content"></div>

            </div>
        </div>
    )
}
export default AboutUsPageAbout
